import React, { Component } from "react";
import Card from "../Card";
import styles from "./index.module.scss";

class App extends Component {
  render() {
    return (
      <div className={styles.App}>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <Card />
        <Card />
        <Card />
        Learn React
      </div>
    );
  }
}

export default App;
